import React from 'react'

const FavoritesList = props => {
  return(
    <>
      <h6>Your Favorite Trails</h6>
      {props.favTrails.map((trail,index) => {
        return(
          <h6>{trail.name}</h6>
        )
      })}
    </>
  )
}

export default FavoritesList
